void dequeue()
{
	while(bales[0] == bales[0+1])
	{
		//int i = 0;
        i = 0;
		while (i < len && i < 14)
		{
			bales[i] = bales[i+1];
			i++;
		}
		bales[i] = 0;
	}

//	int i = 0;
    i = 0;
	len -= 1;
	while (i < len)
	{
		bales[i] = bales[i+1];
		i++;
	}
	bales[i] = 0;
}

void enqueue(int element, int number)
{
	index = -1;
	for (i = 0; bales[i] != 0; i++)
	{
		index = i;
	}
	index++;

	for (j = 0; j < number; j++)
	{
		bales[index] = element;
		index++;
	}
}
